import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import logo from '../images/logo.png';
import '../css/KM.css'

const KM = React.memo(() => {
    return(
        <Container className="wide">
            <Row>
                <Col sm>
                    <img src={logo} className="portrait" alt="portrait"/>
                    <h1>Oliver Jensen</h1>
                </Col>
                <Col sm>
                    <img src={logo} className="portrait" alt="portrait"/>
                    <h1>Johan</h1>
                </Col>
                <Col sm>
                    <img src={logo} className="portrait" alt="portrait"/></Col>
            </Row>
            <Row>
                <Col sm><img src={logo} className="portrait" alt="portrait"/></Col>
                <Col sm><img src={logo} className="portrait" alt="portrait"/></Col>
                <Col sm><img src={logo} className="portrait" alt="portrait"/></Col>
            </Row>
        </Container>
    )
});


export default KM;
